import styled from 'styled-components';

export const NavBar = styled.nav`
  height: 72px;
  background: #fff;
  padding: 0 140px;
  display: flex;
  align-items: center;
  justify-content: space-between;

  .navbar-items {
    display: flex;
    align-items: center;
    justify-content: center;
    &__text {
      margin-right: 1em;
    }
    &__btn {
      width: 134px;
      height: 40px;
      background: red !important;
    }
  }
`;
